import React from 'react';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Login from './components/Login'
import Register from './components/Register'
import data from './components/back/Data/Data';
import Header from './components/front/Header/Header';
import Detail from './components/front/Detail/Detail';
import Profile from './components/front/Profile/Profile';
import ListCategory from './components/front/Category/ListCategory';
import EditCategory from './components/front/Category/EditCategory';
import ListProduct from './components/front/Product/ListProduct';
import EditProduct from './components/front/Product/EditProduct';
import UserComplain from './components/front/Complain/UserComplain';
import AdminComplain from './components/front/Complain/AdminComplain';
import Cart from './components/front/Cart/Cart';
import PrivateRoute from './components/PrivateRoute';
import GuestGreeting from './components/GuestGreeting';

function App() {
  const { productItems } = data;
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Header />} />
          <Route path='/login' element={<Login />} />
          <Route path='/register' element={<Register />} />

          <Route path='/' element={<PrivateRoute />}>
            <Route path='/profile' element={<Profile />} />
            <Route path='/cart' element={<Cart />} />
            <Route path='/list-category' element={<ListCategory />} />
            <Route path='/edit-category' element={<EditCategory />} />
            <Route path='/list-product' element={<ListProduct />} />
            <Route path='/edit-product' element={<EditProduct />} />
            <Route path='/user-complain' element={<UserComplain />} />
            <Route path='/admin-complain' element={<AdminComplain />} />
            <Route path='/product/:id' element={<Detail />} />
          </Route>
        </Routes>
      </BrowserRouter >
    </div>

  );
}

export default App;
